import { LOCALES } from "../locales";

export default {
  [LOCALES.FRENCH]: {
    hello: "Bonjour, {name}!",
    login: "S'identifier",
    loginpage: "page de connexion",
    register: "S'inscrire",
    registerpage: "page d'inscription",
    home: "Accueil",
  },
};
